There are no binary productions A→BC whose B comes from the cell at i and C from i+1 in any of the length‑2 spans, so all length‑2 cells are empty.  Since longer spans can only build on nonempty shorter spans, the full span (1–7) remains empty.  Thus S cannot derive the 7‑token string.

